import { Link } from "react-router-dom";

export default function CountryPage_BorderCountries({borderlist, name, code}) {
    console.log(borderlist)
    if(borderlist.length < 1) {
        return <div className="CountryBorderName">Any borders</div>
    }

    return(
        <>
            <span> list of countries that border the </span>
            <Link to={`/Country/${name}/${code}`} className="CountryWidgetInList">
                <div className="CountryBorderName">{name}</div>
            </Link>
        </>

    )
}
